import React from "react";
import { Menu, Button, Dropdown } from "antd";

const menu = (
  <Menu>
    <MenuItem>
      <a target="_blank" rel="noopener noreferrer" href="#">
        1st menu item
      </a>
    </MenuItem>
  </Menu>
);

function Control() {
  return (
    <Dropdown overlay={menu} placement="bottomCenter">
      <Button>bottomCenter</Button>
    </Dropdown>
  );
}

export default Control;
